import React, { useEffect, useState } from 'react'

const Lifecycle = () => {
  const [isVisible, setIsVisible] = useState(false)

  const toggle = () => {
    setIsVisible(!isVisible)
  }

  return (
    <div style={{ padding: '20px' }}>
      <button onClick={toggle}>On/Off</button>
    </div>
  )
}

export default Lifecycle
